(2, 'Ideas Bip es un santuario de creatividad donde las emociones se transforman en arte a través del crochet, pintura, macramé y manualidades. Nos dedicamos a convertir ideas en experiencias tangibles, ofreciendo talleres interactivos y productos personalizados que cuentan historias únicas. Nuestra comunidad florece en redes sociales y eventos donde la creatividad y las emociones se celebran. En asociación con artistas locales y terapeutas emocionales, promovemos el bienestar a través del arte. Únete a nosotros para explorar el poder de las emociones y la creatividad en un espacio donde las ideas cobran vida.', 'IdeasBip', 'kalexmiguelalba@gmail.com', 'null', '0985339457', 'Piedrahita', 'Buenos Aires', 0.222344, -78.262, 5, 29, NULL, NULL, NULL, 'ACTIVE', 0, '/uploads/business/information/1713033655_Logo-fondo-blanco.png', NULL, 0, 0, 0, 0, 0, 'IdeasBip', 0, NULL, 0, 3, 1, '100');
