INSERT INTO `routes_map` (`id`, `type`, `name`, `description`, `status`, `created_at`, `updated_at`, `deleted_at`, `options_map`, `src`) VALUES
(1, 1, 'Cómo llegar a Wuantun Rumi - Otavalo', 'Es una formación rocosa de origen volcánico de 15m de alto, a 7 km de la ciudad de Otavalo. Ideal para caminatas, senderismo, picnic, fotografía y camping.', 'ACTIVE', '2024-02-29 21:32:58', '2024-02-29 21:32:58', NULL, '{\"zoom\":14,\"tilt\":0,\"mapTypeId\":\"roadmap\",\"center\":{\"lat\":0.24134950546998465,\"lng\":-78.24003599999999}}', '/uploads/business/information/1709260378_01.jpg'),
(2, 1, 'La Cueva del Lobo', 'En un tranquilo recorrido de una hora y media yace una ruta hacia la morada del lobo, un santuario natural donde se entrelazan plantas y árboles autóctonos. A lo largo del sendero, se despliega un paisaje donde el bambú se alza majestuoso, saludando a los visitantes con su verdor exuberante. Al final del trayecto, emerge un escenario mágico: un inmenso árbol, como guardián centenario, reposa sobre una gigantesca piedra, como si de un trono se tratase. Su imponente presencia invita a la reflexión y al descanso, dejando una huella indeleble en el alma de quienes se aventuran a conocer el misterioso hogar del lobo.', 'ACTIVE', '2024-03-01 12:03:35', '2024-03-01 12:05:01', NULL, '{\"zoom\":17,\"tilt\":0,\"mapTypeId\":\"roadmap\",\"center\":{\"lat\":0.16908135756043238,\"lng\":-78.16334270402729}}', '/uploads/business/information/1709312615_01.jpeg');
